import React from "react";

const Navbar = () => {
  return (
    <div
      style={{ background: "#0000" }}
      className="ui secondary inverted pointing menu"
    >
      <a href="/" className="active item">
        Main
      </a>
      <a href="/" className="item">
        My Blogs
      </a>
      <a href="/" className="item">
        Create
      </a>
    </div>
  );
};

export default Navbar;
